script: |
  super -f text -I q1091.spq | sort > q1091.out

inputs:
  - name: q1091.spq
    data: |
      SELECT col2 * - 30 - - + col0 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( - 76 * - + 29 + col1 IN ( col2 ) );
  - name: tab0

outputs:
  - name: q1091.out
    data: |
      -1395
      -213
      -2873
